import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-411588068c082",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/mlf/Documents/Dist/学习笔记/maolfBook/docs/README.md").then(comp => {
        Vue.component("v-411588068c082", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-72d7aa56ca7df",
    path: "/config.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/mlf/Documents/Dist/学习笔记/maolfBook/docs/config.md").then(comp => {
        Vue.component("v-72d7aa56ca7df", comp.default)
        next()
      })
    }
  },
  {
    name: "v-c051e1271df8b",
    path: "/guide/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/mlf/Documents/Dist/学习笔记/maolfBook/docs/guide/README.md").then(comp => {
        Vue.component("v-c051e1271df8b", comp.default)
        next()
      })
    }
  },
  {
    path: "/guide/index.html",
    redirect: "/guide/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
